import React from "react";

export default function ProfileVideo({ videoLink }) {
  return (
    <div>
      {/* <iframe width="420" height="315" className="w-100"
        src={videoLink} allowFullScreen>
      </iframe> */}
      <iframe width="727" height="409" src="https://www.youtube.com/embed/Vu0YyxIqlyY?list=RDMM-9Rng8OuM10" frameBorder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowFullScreen></iframe>
    </div>
  );
}
